import React, { useState } from "react";
import Button from "./Button";
import "./Input.css";

function Input() {


  return (
    <>
      <div className="rectangle">
        <Button />
      </div>
      <div className="rectangle">
        <input type="radio" className="radio" />
        <input type="text" className="text" />
      </div>
      <div className="rectangle">
        <input type="radio" className="radio" />
        <input type="text" className="text" />
      </div>
    </>
  );
}

export default Input;
